        {/* <UserInfo /> */}
        {/* <BalanceStats /> */}
        {/* <Anouncements /> */}
        {/* <Activities token={cookies.get("login")} /> */}
        {/* <Project token={cookies.get("login")} /> */}
      </Dash>
    </Router>
  );
};

export default Dashboard;
